import React from 'react';
import logo from './logo.svg';
import './App.css';
import Header from "./components/Header";
import Products from "./components/Products";

class App extends React.Component{
  render(){
    return(
      <div>
        <Header />
        <Products name="Iphone 7 Plus 128GB" srcHinh="data:image/jpeg;base64,"/>
        <Products name="Iphone X 64GB" srcHinh="data:image/jpeg;base64,"/>
        <Products name="Iphone 11 Pro 512GB" srcHinh="data:image/jpeg;base64,"/>
      </div>
    );
  }
}

export default App;




